/** @jsxImportSource theme-ui */
import {
  IonBackButton,
  IonButtons,
  IonCard,
  IonCardContent,
  IonCardHeader,
  IonCardSubtitle,
  IonCardTitle,
  IonCol,
  IonContent,
  IonDatetime,
  IonGrid,
  IonHeader,
  IonItem,
  IonLabel,
  IonMenuButton,
  IonPage,
  IonRow,
  IonTitle,
  IonToolbar,
} from "@ionic/react";
import React, { useState } from "react";

const Calendar: React.FC = () => {
  const [time, setTime] = useState(new Date().toISOString());
  const [bookings, setBookings] = useState([
    {
      bookingId: "98",
      clientName: "hello",
      complexName: "",
      packageName: "",
      price: "",
      startTime: "",
      endTime: "",
    },
  ]);
  const updateTime = (currentTime: any) => {
    setTime(currentTime);
  };
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar color="primary">
          <IonButtons slot="start">
            <IonMenuButton />
          </IonButtons>
          <IonTitle>Calendar</IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent fullscreen>
        <IonGrid>
          <IonRow>
            <IonCol>
              <IonItem>
                <IonLabel>Date</IonLabel>
                <IonDatetime
                  min="2021"
                  value={time}
                  onIonChange={(e) => updateTime(e.detail.value)}
                />
              </IonItem>
            </IonCol>
          </IonRow>
          {bookings.length > 1 ? (
            bookings.map((booking) => {
              <IonRow>
                <IonCol>
                  <IonCard>
                    <IonCardHeader>
                      <IonCardTitle>{booking.clientName}</IonCardTitle>
                      <IonCardSubtitle>{booking.complexName}</IonCardSubtitle>
                    </IonCardHeader>
                    <IonCardContent>
                      <IonRow>{booking.packageName}</IonRow>
                      <IonRow>{booking.price}</IonRow>
                      <IonRow>{booking.startTime}</IonRow>
                      <IonRow>{booking.endTime}</IonRow>
                    </IonCardContent>
                  </IonCard>
                </IonCol>
              </IonRow>;
            })
          ) : (
            <h2 sx={styles.heading}>No Bookings</h2>
          )}
        </IonGrid>
      </IonContent>
    </IonPage>
  );
};

export default Calendar;

const styles = {
  heading:{
    display: 'flex',
    justifyContent: 'center'
  },
}
